import React from 'react';
import './App.css';

function Board() {
  let board = []

  for(let i=0; i<=3; i++){
    board.push(<div id={i} class='board-row'/>)
    for(let i=0; i<=1; i++){
    board.push(<div id={i} class='square' />)
  }
}
  return board;
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Board/>
      </header>
    </div>
  );
}

export default App;
